INSERT INTO device_models (name, manufacturer, description, documentation_link, photo_link, protocol, tags, device_type) VALUES ('DSM', 'Teltonika', 'DSM (Driver Safety and Monitoring solution). This product with Deep-Learning technology can support drowsiness, distraction and yawning attention warnings as well as periodic event data and picture footage transfer.', 'https://teltonika-gps.com/products/accessories/video-telematics/teltonika-dsm', 'https://gh.traxtex.com/imgs/devices/teltonika/370px-Mdsm22_106.png', 'Teltonika', '{}', 9);
INSERT INTO device_models (name, manufacturer, description, documentation_link, photo_link, protocol, tags, device_type) VALUES ('Teltonika ADAS', 'Teltonika', 'The ADAS is an advanced driver safety system designed to save lives, increase awareness of bad driving habits & record driving statistics (with video) for fleet management users and conventional drivers alike. Together with Teltonika''s FMX6 trackers, all collected information including ADAS IO and can be forwarded to the server of choice even the video and photo requests or even event triggers which can occur when accidents happen. This installation manual highlights the most important information required and assumes an experienced installer uses common industry practices for a successful integration.', 'https://teltonika-gps.com/lt/product/adas', 'https://gh.traxtex.com/imgs/devices/teltonika/500px-MDAS-9_2.jpg', 'Teltonika', '{}', 9);
INSERT INTO device_models (name, manufacturer, description, documentation_link, photo_link, protocol, tags, device_type) VALUES ('Teltonika DashCam', 'Teltonika', 'Teltonika DashCam solution is perfect for capturing videos or pictures of the events that might occur on the road, e.g. crash. Mounted on the vehicle front window, one camera are used, front, to record videos before and after the events, take photos periodically or by request and send all data to the server. Also the possibility to connect two cameras, DSM and DashCam or DualCam, to one device, FMC650. By utilizing the two RS232 ports on the FMC650, you can connect the DSM camera for driver status monitoring to one port and the DualCam or DashCam camera for road and cargo monitoring to the second port. Configuration', 'https://wiki.teltonika-gps.com/view/Teltonika_DashCam', 'https://gh.traxtex.com/imgs/devices/teltonika/500px-558163_DashCam-2023-04-26_v1_%281%29.png', 'Teltonika', '{}', 9);
INSERT INTO device_models (name, manufacturer, description, documentation_link, photo_link, protocol, tags, device_type) VALUES ('Teltonika DualCam', 'Teltonika', 'Teltonika DualCam solution is perfect for capturing videos or pictures of the events that might occur on the road, e.g. crash. Mounted on the vehicle front window, two cameras are used, front and rear, to record videos before and after the events, take photos periodically or by request and send all data to the server.', 'https://teltonika-gps.com/lt/product/dualcam', 'https://gh.traxtex.com/imgs/devices/teltonika/500px-471085_DualCam-2022-02-08_%281%29.png', 'Teltonika', '{}', 9);
