INSERT INTO device_models (name, manufacturer, description, documentation_link, photo_link, protocol, tags, device_type) VALUES ('EYE SENSOR / BTSMP1', 'Teltonika', 'Wireless solutions open up new horizons for your business and help to keep an eye on your assets. Discover our brand-new and certified Bluetooth® Low Energy ID sensor model from Teltonika with robust waterproof casing and a long-lifetime battery. The model is designed for a low-cost fast and easy configuration and integration to save precious time, resources, and ensure accountability.', 'https://teltonika-gps.com/eye', 'https://gh.traxtex.com/imgs/devices/teltonika/1157px-BTSMP1-datasheet-2023-12-18.2.png', 'Teltonika', '{}', 5);
INSERT INTO device_models (name, manufacturer, description, documentation_link, photo_link, protocol, tags, device_type) VALUES ('EYE BEACON / BTSID1', 'Teltonika', 'Wireless solutions open up new horizons for your business and help to keep an eye on your assets. Discover our brand-new and certified Bluetooth® Low Energy ID beacon model from Teltonika with robust waterproof casing and a long-lifetime battery. The model designed for a low-cost fast and easy configuration and integration to save precious time, resources, and ensure accountability.', 'https://teltonika-gps.com/eye', 'https://gh.traxtex.com/imgs/devices/teltonika/1157px-BTSID1-datasheet-2023-12-18.2.png', 'Teltonika', '{}', 5);
